    false,nt"url": null,nt"notes": "This data set includes 59 georeferenced
    versions of original black and white aerial photographs from November 1941, acquired
    in digital form from the National Archives and Records Administration (NARA) for
    Baca National Wildlife Refuge. These photo in this collection, from 1941, is one
    of the earliest know for this area and were part of the USDA's Agricultural Adjustment
    Administration's effort to capture the extent and condition of farmland across the
    US. Individual frames were referenced to the 2009 NAIP color imagery with ArcMap
    10.0. The resolution of the image is 0.8 meters. This image should be used for resource-level
    interpretation only.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
